import { Container, Box, Text } from "@chakra-ui/react";
import React from "react";

const Homepage = () => {
  return (
    <Container maxW="Xl" centerContent>
      <Box
        d="flex"
        p={3}
        bg={"white"}
        w="50%"
        m="40px 0 15px 0"
        borderRadius="lg"
        borderWidth="1px"
        textAlign="center"
      >
        <Text fontSize="4xl" fontFamily="work sans" color="black">
          Chatster
        </Text>
      </Box>
      <Box bg="white" W="500%" p={4} borderRadius="lg" borderWidth="1px"></Box>
    </Container>
  );
};

export default Homepage;
